class Node {
  left = null;
  rigth = null;
  count = 0;
  constructor(val) {
    this.val = val;
  }
}
// 바이너러 서치 트리는 검색과 삽입시 로그시간이다.
class BST {
  root = null;

  insert(val) {
    const newNode = new Node(val);
    if (!this.root) {
      this.root = newNode;
      return this;
    }
    let currnet = this.root;
    while (true) {
      if (val < currnet.val) {
        if (!currnet.left) {
          currnet.left = newNode;
          return this;
        }
        currnet = currnet.left;
      } else if (val > currnet.val) {
        if (!currnet.rigth) {
          currnet.rigth = newNode;
          return this;
        }
        currnet = currnet.rigth;
      } else {
        currnet.count++;
        return this;
      }
    }
  }

  find(val) {
    if (!this.root) return null;
    let current = this.root;
    while (current) {
      if (current.val === val) return true;
      else if (val < current.val) current = current.left;
      else current = current.rigth;
    }
    return false;
  }
  // 넓이 우선탐색
  BFS() {
    // 큐를 사용해 방문해야할곳의 목록을 저정하여 사용한다.
    if (!this.root) return [];
    let data = [],
      queue = [],
      node;
    queue.push(this.root);
    while (queue.length) {
      node = queue.shift();
      data.push(node.val);
      if (node.left) queue.push(node.left);
      if (node.rigth) queue.push(node.rigth);
    }
    return data;
  }
  // 깊이우선탐색(전위 우선탐색)
  // 노드부터 방문하여 왼쪽에서 오른쪽으로 순회한다.
  DFSpreOrder() {
    if (!this.root) return [];
    const data = [];
    const travers = (node) => {
      data.push(node.val);
      if (node.left) travers(node.left);
      if (node.rigth) travers(node.rigth);
      return undefined;
    };
    travers(this.root);
    return data;
  }
  // 후위 우선탐색
  // 노드를 나중에 방문하고 그전에 왼쪽 마지막 브랜치 부터 순회한다.
  DFSpostORder() {
    if (!this.root) return [];
    const data = [];
    const travers = (node) => {
      if (node.left) travers(node.left);
      if (node.rigth) travers(node.rigth);
      return data.push(node.val);
    };
    travers(this.root);
    return data;
  }
  // 정위 탐색
  DFSinOrder() {
    if (!this.root) return [];
    const data = [];
    // 15
    const travers = (node) => {
      if (node.left) travers(node.left);
      data.push(node.val);
      // 15
      if (node.rigth) travers(node.rigth);
      return undefined;
    };
    travers(this.root);
    return data;
  }
}

const tree = new BST();
tree.insert(10);
// tree.insert(6);
tree.insert(15);
// tree.insert(3);
// tree.insert(4);
// tree.insert(8);
tree.insert(20);
tree.insert(17);
//     10
//   6      15
// 3  8    17 20
console.log(tree.DFSinOrder());
